-- --------------------------------------------------------------------------------------------------- dim 维度数据库建表
drop database if exists dim;
create database dim default character set = utf8 collate = utf8_general_ci;
use dim;

create table if not exists dim.base_date(
    trade_date              varchar(32) comment '日期编码',
    year_code               int(8) comment '年编码',
    month_code              int(8) comment '月份编码',
    day_code                int(8) comment '日编码',
    quanter_code            int(8) comment '季度编码',
    quanter_name            varchar(8) comment '季度名称',
    week_trade_date         varchar(32) comment '周一时间',
    month_trade_date        varchar(32) comment '月一时间',
    week_end_date           varchar(32) comment '周末时间',
    month_end_date          varchar(32) comment '月末时间',
    last_week_trade_date    varchar(32) comment '上周一时间',
    last_month_trade_date   varchar(32) comment '上月一时间',
    last_week_end_date      varchar(32) comment '上周末时间',
    last_month_end_date     varchar(32) comment '上月末时间',
    year_week_code          int(8) comment '一年中第几周',
    week_day_code           int(8) comment '周几code',
    day_year_num            int(8) comment '一年第几天',
    month_days              int(8) comment '本月有多少天',
    is_weekend              int(8) comment '是否周末（周六和周日）',
    days_after1             varchar(32) comment '1天后的日期',
    days_after2             varchar(32) comment '2天后的日期',
    days_after3             varchar(32) comment '3天后的日期',
    days_after4             varchar(32) comment '4天后的日期',
    days_after5             varchar(32) comment '5天后的日期',
    days_after6             varchar(32) comment '6天后的日期',
    days_after7             varchar(32) comment '7天后的日期',
    primary key (trade_date)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '时间维度表';

create table if not exists dim.store(
    id                          int(8) not null auto_increment comment '自增主键',
    store_no                    varchar(64) comment '分店编号',
    store_name                  varchar(64) comment '分店名称',
    store_short_name            varchar(32) comment '分店简称',
    region_code                 varchar(64) comment '区域编码',
    management_type_code        varchar(8) comment '经营类型1直营 2加盟',
    store_type_code             varchar(32) comment '分店类型',
    province_id                 int(20) comment '省份id',
    province_name               varchar(32) comment '省份名称',
    city_id                     int(20) comment '城市id',
    city_name                   varchar(32) comment '城市名称',
    address                     varchar(127) comment '地址(不详)',
    longitude                   decimal(38, 18) comment '经度(116.40184)',
    latitude                    decimal(38, 18) comment '纬度(40.00294)',
    worker_num                  int(8) comment '员工人数',
    manager_name                varchar(32) comment '经理姓名',
    telephone                   varchar(32) comment '分店电话(114)',
    opening_date                varchar(32) comment '开店日期',
    open_time                   varchar(32) comment '营业开始时间',
    close_time                  varchar(32) comment '营业结束时间',
    `status`                    int(8) comment '状态 1：开店  2：闭店',
    is_deleted                  int(8) comment '是否删除 0:否  1:是',
    flag                        int(8) comment '二进制标识，0初始值，16日清',
    store_version_code          int(8) comment '门店版本(1-1.0版本，16-2.0版本，32-3.0版本)',
    decoration_code             varchar(32) comment '装修标识',
    create_time                 timestamp default current_timestamp comment '创建时间',
    update_time                 timestamp default current_timestamp comment '修改时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment = '分店信息表'
;

create table if not exists dim.store_group(
    id                  int(20) not null auto_increment comment '自增主键',
    store_group_no      varchar(64) comment '店组编号',
    store_group_name    varchar(64) comment '店组名称',
    store_group_type_no varchar(64) comment '店组类型编号',
    parent_id           int(20) comment '父级id',
    is_deleted          int(8) comment '是否删除 0:否  1:是',
    create_time         timestamp default current_timestamp comment '创建时间',
    update_time         timestamp default current_timestamp comment '修改时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment = '店组信息表'
;

create table if not exists dim.store_area_info(
    id              int(20) not null auto_increment comment '自增主键',
    store_no        varchar(64) comment '分店编号',
    area_type_no    varchar(64) comment '面积类型编号',
    area_type_name  varchar(64) comment '面积类型名称',
    area            decimal(27, 2) comment '面积',
    is_deleted      int(8) comment '是否删除 0:否  1:是',
    create_time     timestamp default current_timestamp comment '创建时间',
    update_time     timestamp default current_timestamp comment '修改时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment = '分店面积明细表'
;

create table if not exists dim.goods_info(
    id                      int(20) not null auto_increment comment '自增主键',
    goods_no                varchar(64) comment '系统维护商品唯一编号',
    short_name              varchar(200) comment '简称',
    goods_name              varchar(200) comment '名称',
    category_no             varchar(64) comment '商品类别编号',
    brand_no                varchar(64) comment '品牌编号',
    spec                    varchar(64) comment '商品规格',
    sale_unit               varchar(64) comment '销售单位',
    life_cycle_status       varchar(64) comment '生命周期状态',
    tax_rate_status         int(8) comment '税率审核状态 (0：未提交审核 1：待财务审核 2：税率已审核 3：未通过)',
    tax_rate                varchar(64) comment '税率code',
    tax_value               decimal(27, 3) comment '税率',
    order_multiple          decimal(27, 2) comment '订货倍数',
    pack_qty                decimal(27, 3) comment '箱装数量',
    split_type              varchar(64) comment '分割属性',
    is_sell_by_piece        int(8) comment '是否拆零，0:不拆；1:拆',
    is_self_support         int(8) comment '是否自营 0:非自营；1:自营',
    is_variable_price       int(8) comment '分店可变价 0:不可；1:可以',
    is_double_measurement   int(8) comment '是否双计量商品 0:否；1:是',
    is_must_sell            int(8) comment '必卖品  0:非；1:是',
    is_seasonal             int(8) comment '季节性商品  0:非；1:是',
    seasonal_start_time     varchar(64) comment '季节性开始时间',
    seasonal_end_time       varchar(64) comment '季节性结束时间',
    is_deleted              int(8) comment '是否删除0:正常；1:删除',
    goods_type              varchar(64) comment '商品类型 1-国产食品 2-进口食品 3-国产非食品 4-进口非食品',
    create_time             timestamp default current_timestamp comment '该记录创建时间',
    update_time             timestamp default current_timestamp comment '该记录最后更新时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '商品表'
;

create table if not exists dim.category(
    id                  int(20) not null auto_increment comment '自增主键',
    category_no         varchar(64) comment '分类编号',
    category_name       varchar(64) comment '分类名称',
    parent_id           int(20) comment '父级id',
    level               int(8) comment '等级',
    is_deleted          int(8) comment '否删除 0:否  1:是',
    create_time         timestamp default current_timestamp comment '创建时间',
    update_time         timestamp default current_timestamp comment '最后更新时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '商品分类表'
;

create table if not exists dim.source_type_map(
    id                          int(20) not null auto_increment comment '自增主键',
    company                     varchar(64) comment '公司:1.传智鲜 2.黑马优选',
    original_source_type        int(8) comment '原交易来源 1:线下pos;3:扫码购;4:美团;5:饿了么;6:百度外卖;7:京东到家;8:有赞;9:传智鲜精品;10:黑马优选团;11:团购',
    original_source_type_name   varchar(64) comment '原交易来源名称',
    source_type                 int(8) comment '新交易来源',
    source_type_name            varchar(64) comment '新交易来源名称',
    is_online                   int(8) comment '是否线上交易 0否;1是',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '交易类型映射表'
;

create table if not exists dim.store_goods(
    uid             varchar(64) comment '唯一标识',
    store_no        varchar(64) comment '门店编码',
    goods_no        varchar(64) comment '商品编码',
    goods_name      varchar(200) comment '商品名称',
    category_no     varchar(64) comment '品类编码',
    is_clear        int(8) comment '商品是否日清，0-否，1-是',
    is_must_order   int(8) comment '是否必订品，0-否，1-是',
    is_orderable    int(8) comment '是否可订，0-否，1-是',
    order_multiple  decimal(27,2) comment '订货倍数',
    min_order_qty   decimal(27,2) comment '最小起订量',
    vendor_no       varchar(64) comment '主供应商编码',
    vendor_name     varchar(64) comment '主供应商名称',
    group_no        varchar(64) comment '采购柜组编码',
    group_name      varchar(64) comment '采购柜组名称',
    dc_no           varchar(64) comment '采购仓库编码',
    dc_name         varchar(64) comment '采购仓库名称',
    tag             int(8) comment '商品标识，1-传智鲜标品；2-黑马标品;3-生鲜品;4-其它',
    create_time     timestamp default current_timestamp comment '创建时间',
    update_time     timestamp default current_timestamp comment '最后修改时间',
    is_deleted      int(8) comment '是否删除0:正常；1:删除',
    primary key (`uid`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '门店商品信息'
;

-- -------------------------------------------------------------------------------------------------- sale 售卖主题数据库建表
drop database if exists sale;
create database sale default character set = utf8 collate = utf8_general_ci;
use sale;

create table if not exists sale.store_sale_info(
    id                      int(20) not null auto_increment comment '自增主键',
    order_no                varchar(64) comment '单据唯一编号',
    order_id                int(20) comment '单据唯一编号',
    sale_store_no           varchar(64) comment '销售门店编码',
    store_no                varchar(64) comment '门店编码',
    store_name              varchar(32) comment '门店名称',
    trade_date              timestamp null comment '交易日期',
    pay_date                timestamp null comment '支付日期',
    deal_date               timestamp null comment '库存处理时间',
    pos_no                  varchar(64) comment 'pos机编号',
    ser_id                  int(20) comment '交易序号',
    trade_id                int(8) comment '销售类型:1-销售，2-退货，3-拒收，4-取消',
    parent_order_sn         varchar(64) comment '母单号，如果单据是子单有值',
    source_order_sn         varchar(64) comment '原始单据，退款的单据，则代表是原始销售单据',

    source_type             int(8) comment '销售渠道：1-门店pos，2-商城小程序，3-团购销售',
    cashier_no              varchar(32) comment '收银员编号',
    cashier_name            varchar(64) comment '收银员名称',
    sale_amount             decimal(27, 2) comment '单据总金额(支付+折扣+舍分)//total_amount',
    total_pay_amount        decimal(27, 2) comment '单据总支付金额',
    total_dis_amount        decimal(27, 2) comment '单据总折扣金额',
    round_amount            decimal(27, 2) comment '单据舍分金额',
    member_type             int(8) comment '会员类型',
    member_name             varchar(200) comment '会员名',
    member_center_sn        varchar(64) comment '会员中台编码',
    member_id               int(20) comment '会员编号',
    member_channel          int(8) comment '会员渠道：1-传智鲜，2-黑马',
    card_no                 varchar(64) comment '实体卡号',

    business_code           varchar(32) comment '业务类型:预售、及时达、b2c',
    create_time             timestamp default current_timestamp comment '记录创建时间',
    last_update_time        timestamp default current_timestamp comment '最后更新时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '门店销售信息表'
;

create table if not exists sale.store_sale_dtl(
    id                              int(20) not null auto_increment comment '自增主键',
    order_no                        varchar(64) comment '订单编码',
    order_id                        int(20) comment '订单id',
    sale_store_no                   varchar(64) comment '销售门店编码',
    store_no                        varchar(64) comment '门店编码',
    store_name                      varchar(64) comment '门店名称',
    trade_date                      timestamp null comment '交易日期',
    pay_date                        timestamp null comment '支付日期',
    deal_date                       timestamp null comment '库存处理时间',
    pos_no                          varchar(64) comment 'pos机编号',
    ser_id                          int(20) comment '交易序号',
    trade_id                        int(8) comment '销售类型:1-销售，2-退货，3-拒收，4-取消',
    parent_order_sn                 varchar(64) comment '母单号，如果单据是子单有值',
    source_order_sn                 varchar(64) comment '原始单据，退款的单据，则代表是原始销售单据',

    source_type                     int(8) comment '销售渠道：1-门店pos，2-商城小程序，3-团购销售',
    cashier_no                      varchar(64) comment '收银员编号',
    cashier_name                    varchar(64) comment '收银员名称',
    sales_clerk_no                  varchar(64) comment '售货员编号',
    member_type                     int(8) comment '会员类型',
    member_name                     varchar(64) comment '会员名',
    member_id                       varchar(64) comment '会员编号',
    member_channel                  int(8) comment '会员渠道：1-传智鲜，2-黑马',
    card_no                         varchar(64) comment '实体卡号',

    business_code                   varchar(64) comment '业务类型',
    goods_no                        varchar(64) comment '商品编码',
    goods_name                      varchar(200) comment '商品名称',
    channel_goods_no                varchar(64) comment '渠道商品编码',
    unit                            varchar(64) comment '单位',
    spec                            varchar(64) comment '规格',
    init_price                      decimal(27, 2) comment '原始价格',
    sale_price                      decimal(27, 2) comment '售价',
    price                           decimal(27, 2) comment '实际成交价',
    cost_price                      decimal(27, 2) comment '商品成本价',
    item                            int(20) comment '商品序号',
    trade_mode_id                   int(8) comment '结算方式',
    is_daily_clear                  int(8) comment '是否日清，1-日清，0-非日清',
    sale_cost                       decimal(27, 2) comment '商品成本',
    sale_qty                        decimal(27, 3) comment '商品数量',
    sale_amount                     decimal(27, 2) comment '商品销售金额',
    dis_amount                      decimal(27, 2) comment '商品折扣金额',
    vendor_id                       int(20) comment '供应商编码',
    vendor_name                     varchar(64) comment '供应商名称',
    contract_no                     varchar(64) comment '合同号',
    batch_no                        varchar(64) comment '库存批次号',
    combination_flag                int(8) comment '1-组合商品，2-组合成分',
    `sort`                          int(20) comment '序号',
    offset_flag                     int(8) comment '是否为冲减单，1-是，0-否',
    commission_amount               decimal(27, 2) comment '分佣金额',
    share_user_id                   varchar(64) comment '分销者id（分享者id）',
    tag                             int(8) comment '标记 0.默认 1.子商品盈余批次 2.母商品亏损批次',
    first_share_id                  varchar(64) comment '一级分享人',
    shipping_type                   int(8) comment '订单类别',
    create_time                     timestamp default current_timestamp comment '记录创建时间',
    primary key (`id`)
)
    engine = innodb
    default character set = utf8 collate = utf8_general_ci
    comment '门店销售明细表'
;

create table if not exists sale.shop_order(
    id                      int(20) not null auto_increment comment '自增主键',
    parent_order_no         varchar(64) comment '父单订单号',
    order_id                varchar(64) comment '订单编号',
    is_split                int(8) comment '是否拆单：0-不需要拆单；1-待拆单；2-已拆单',
    platform_id             int(8) comment '平台id：1-有赞，2-京东到家，3-美团外卖，4-饿了么',
    tid                     varchar(64) comment '平台订单号',
    source_type             int(8) comment '订单来源：10,20,30,40,41,50,60,70',
    source_name             varchar(32) comment '订单来源名称：10-有赞，20-京东到家，30-美团外卖，40-饿了么，41-百度外卖，50-传智鲜精选，60-黑马优选，70-抖店',
    store_no                varchar(64) comment '门店编码',
    city_id                 int(20) comment '城市编号',
    city_name               varchar(32) comment '城市名称',
    region_code             varchar(64) comment '区域编码',

    order_status            int(8),
    order_status_desc       varchar(32) comment '主订单状态描述：0-新建; 1-待出票；2-待备货；3-待揽件；4-待自提; 5-配送中；6-已完成；7-已取消',
    pay_type                int(8) comment '支付类型：1-线下支付；2-线上支付',
    trade_type              varchar(32) comment '交易类型。取值范围：fixed(一口价) gift(送礼）bulk_purchase（来自分销商的采购）present （赠品领取）group （拼团订单） pifa （批发订单） cod （货到付款） peer （代付） qrcode（扫码商家二维码直接支付的交易）qrcode_3rd（线下收银台二维码交易)',
    is_deleted              int(8) default 0 comment '是否有效，1：已删除，0：正常',

    order_create_time       timestamp null comment '平台订单创建时间',
    order_pay_time          timestamp null comment '订单支付时间',
    create_time             timestamp default current_timestamp comment '创建时间',
    print_status            int(8) comment '打印状态：0-未打票;1-已打票',
    print_time              timestamp null comment '出票时间',
    stock_up_status         int(8) comment '门店处理状态：0-待备货/1-已备货',
    stock_up_time           timestamp null comment '备货完成时间',

    order_type              int(8) comment '配送类型（真正的订单类型由业务类型来决定）：1-及时送；2-隔日送；3-自提单',
    express_type            int(8) comment '配送方式：0-三方平台配送；1-自配送；2-快递；3-自提',
    receive_time            timestamp null comment '要求送达/自提时间',
    express_code            varchar(64) comment '配送单号',
    delivery_status         int(8) comment '配送状态：0-待配送；1-配送中；2-已送达',
    delivery_time           timestamp null comment '配送时间',
    pick_up_status          int(8) comment '自提状态：0-待自提；1-已自提',
    qr_code                 varchar(64) comment 'qr提货码',
    pick_up_time            timestamp null comment '自提时间',

    complete_time           timestamp null comment '订单完结时间',
    is_cancel               int(8) comment '是否取消',
    cancel_time             timestamp null comment '取消时间',
    cancel_reason           varchar(255) comment '取消原因',
    refund_status           int(8) comment '退款状态：0未退款，1部分退款，2已全额退款',
    refund_time             timestamp null comment '已退款时间',
    last_update_time        timestamp default current_timestamp comment '最新更新时间',

    order_total_amount      decimal(27, 2) comment '订单总金额',
    product_total_amount    decimal(27, 2) comment '商品总金额（原价）',
    pack_amount             decimal(27, 2) comment '餐盒费/打包费',
    delivery_amount         decimal(27, 2) comment '配送费',
    discount_amount         decimal(27, 2) comment '订单优惠金额=商家承担优惠金额+平台补贴金额',
    seller_discount_amount  decimal(27, 2) comment '商家承担优惠金额',
    platform_allowance_amount decimal(27, 2) comment '平台补贴金额',
    real_paid_amount        decimal(27, 2) comment '实付金额',
    product_discount        decimal(27, 2) comment '商品优惠金额',
    real_product_amount     decimal(27, 2) comment '商品实际金额',

    buyer_id                int(20) comment '买家id',
    buyer_phone             varchar(16) comment '买家电话',
