-- ----history-------------

-- 常量
select @diff := DATEDIFF(CURRENT_DATE,'2022-08-01');
select @dt := DATE_SUB(NOW(),interval 3000 day);

-- 插入数据
truncate table sale.store_sale_info;
select
    id               
    ,order_no         
    ,order_id         
    ,sale_store_no    
    ,store_no         
    ,store_name       
    ,date_add(if(trade_date<'2022-08-01',trade_date,null), interval @diff day) as trade_date
    ,date_add(if(pay_date<'2022-08-01',pay_date,null), interval @diff day) as pay_date
    ,date_add(if(deal_date<'2022-08-01',deal_date,null), interval @diff day) as deal_date     
    ,pos_no           
    ,ser_id           
    ,trade_id         
    ,parent_order_sn  
    ,source_order_sn  
               
    ,source_type      
    ,cashier_no       
    ,cashier_name     
    ,sale_amount      
    ,total_pay_amount 
    ,total_dis_amount 
    ,round_amount     
    ,member_type      
    ,member_name      
    ,member_center_sn 
    ,member_id        
    ,member_channel   
    ,card_no          
              
    ,business_code
    ,date_add(greatest(trade_date,
		if(pay_date<'2022-08-01',pay_date,@dt),
		if(deal_date<'2022-08-01',deal_date,@dt)), interval @diff day) as create_time
     ,date_add(greatest(trade_date,
		if(pay_date<'2022-08-01',pay_date,@dt),
		if(deal_date<'2022-08-01',deal_date,@dt)), interval @diff day) as last_update_time       
from temp.store_sale_info
where DATE_FORMAT(trade_date,'%Y-%m-%d')<'2022-08-01'
; 

