    ,date_add(if(receive_time<'2022-08-01',receive_time,null), interval @diff day) as receive_time            
    ,express_code            
    ,delivery_status         
    ,date_add(if(delivery_time<'2022-08-01',delivery_time,null), interval @diff day) as delivery_time           
    ,pick_up_status          
    ,qr_code                 
    ,date_add(if(pick_up_time<'2022-08-01',pick_up_time,null), interval @diff day) as pick_up_time            
                    
    ,date_add(if(complete_time<'2022-08-01',complete_time,null), interval @diff day) as complete_time           
    ,is_cancel               
    ,date_add(if(cancel_time<'2022-08-01',cancel_time,null), interval @diff day) as cancel_time             
    ,cancel_reason           
    ,refund_status           
    ,date_add(if(refund_time<'2022-08-01',refund_time,null), interval @diff day) as refund_time             
    ,date_add(greatest(print_time,
		if(stock_up_time<'2022-08-01',stock_up_time,@dt),
		if(receive_time<'2022-08-01',receive_time,@dt),
		if(delivery_time<'2022-08-01',delivery_time,@dt),
        if(pick_up_time<'2022-08-01',pick_up_time,@dt),
		if(complete_time<'2022-08-01',complete_time,@dt)), interval @diff day) as last_update_time 
		          
    ,order_total_amount      
    ,product_total_amount    
    ,pack_amount             
    ,delivery_amount         
    ,discount_amount         
    ,seller_discount_amount  
    ,platform_allowance_amount 
    ,real_paid_amount        
    ,product_discount        
    ,real_product_amount     
                      
    ,buyer_id                
    ,buyer_phone             
    ,buyer_remark            
    ,r_name                  
    ,r_tel                   
    ,r_province              
    ,r_city                  
    ,r_district              
    ,r_address               
    ,r_zipcode               
                    
    ,is_tuan_head            
    ,store_leader_id         
    ,order_group_no          
    ,commision_amount        
    ,settle_amount           
                   
    ,points_amount           
    ,pay_point               
    ,balance_amount          
    ,pay_channel_amount      
    ,point_amount            
                    
    ,sync_erp_status         
    ,sync_erp_msg            
from temp.shop_order
where DATE_FORMAT(create_time,'%Y-%m-%d')<'2022-08-01'
; 

